import React, { useState } from 'react';
import axios from 'axios';

const TestMatching = () => {
  const [result, setResult] = useState('');
  const [loading, setLoading] = useState(false);

  const testMatching = async () => {
    try {
      setLoading(true);
      setResult('Testing matching...');
      
      const response = await axios.get('http://localhost:5000/api/reports/test/matching', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });

      if (response.data.success) {
        setResult(`Test completed! Check server console for details. Total reports: ${response.data.totalReports}`);
      } else {
        setResult('Test failed: ' + response.data.message);
      }
    } catch (error) {
      console.error('Test error:', error);
      setResult('Test failed: ' + (error.response?.data?.message || error.message));
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="bg-white shadow rounded-lg p-6">
          <h1 className="text-2xl font-bold text-gray-900 mb-4">Test Matching Logic</h1>
          
          <button
            onClick={testMatching}
            disabled={loading}
            className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 disabled:opacity-50"
          >
            {loading ? 'Testing...' : 'Test Matching'}
          </button>
          
          {result && (
            <div className="mt-4 p-4 bg-gray-100 rounded">
              <p className="text-gray-800">{result}</p>
            </div>
          )}
          
          <div className="mt-6">
            <h2 className="text-lg font-semibold text-gray-900 mb-2">Instructions:</h2>
            <ol className="list-decimal list-inside space-y-1 text-gray-600">
              <li>Click "Test Matching" button</li>
              <li>Check your server console for detailed logs</li>
              <li>Look for reports in the database and matching results</li>
              <li>Verify if the search criteria is working correctly</li>
            </ol>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TestMatching;
